import React from 'react';
import Logo from './logo.png';
import Iconimg from './test-img4.png';
import './Navbar.css';

const Navbar=()=> {

    return(
        <div>

            <nav className="navbar navbar-light bg-white">
                <a className="navbar-brand pl-5"><img src={Logo} width="140" alt="logo"/></a>

                    <form className="form-inline">
                        <div class="img-icon d-flex"><img src={Iconimg} width="50" alt="logo"/>
                            <h6 class="px-2 pt-3">Angelina Deo</h6>
                        </div>
                        <li><a href="" target="blank"><i class="text-facebook fa fa-facebook-square" aria-hidden="true"></i></a></li>
                        <li><a href="" target="blank"><i class="text-insta fa fa-instagram pl-5" aria-hidden="true"></i></a></li>            
                        <li><a href="" target="blank"><i class="text-danger fa fa-email pl-5" aria-hidden="true"></i></a></li>
                        <li><a href="" target="blank"><i class="text-primary fa fa-linkedin-square pl-5" aria-hidden="true"></i></a></li>
                        {/* <input className="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search" />
                        <button className="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button> */}
                    </form>
            </nav>

        </div>
    );
}



export default Navbar;
